import './App.css';
import SiteNavBar from './components/SiteNavBar';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from './'

function App() {
    return (
        <>
            <SiteNavBar />
            <Route path="/" element={<Home />} />
        </>
    );
}

export default App;
